import React from "react";
import s from "./Users.module.css"

const Paginator =({pages,onPageChange,currentPage})=> {
    return (
    <div className={s.paginator}>
        {pages.map(p => (<span className={currentPage === p && s.active}
                                     key={p.id}
                                     onClick={(p) => {
                                         onPageChange(p)
                                     }}>
                    {p}</span>))}
    </div>
)
}
export default Paginator;
